    <React.Fragment>
      <CssBaseline />
      <ElevationScroll {...props}>
        <AppBar>
        <Container>
          <Toolbar>
            <Box sx={{ flexGrow: 0, display: { xs: 'none', md: 'flex' } }}>
              <Grid container direction={'row'} spacing={2} alignItems="center" >
                <Grid item xs={2}>
                  <Link to='/'>
                    <span style={{ color: 'white', textDecoration: 'none' }}>Find-A-Crop</span>
                  </Link>
                </Grid>
                <Grid item xs={2}>
                  <Link to='/'>
                    <span style={{ color: 'white', textDecoration: 'none' }}>Name-A-Crop</span>
                  </Link>
                </Grid>

                <Grid item xs={2}>
                  <Link to='/about-us'>
                    <span style={{ color: 'white' }}>About Us</span>
                  </Link>
                </Grid>
                <Grid item xs={2}>
                  <Link to='/login'>
                    <Button
                      variant="contained"
                      size="large"
                      sx={{
                        backgroundColor: "#308335",
                      }}
                    >
                      LOGIN
                    </Button>
                  </Link>
                </Grid>
              </Grid>
            </Box>
          </Toolbar>
          </Container>
        </AppBar>
      </ElevationScroll>
      <Toolbar />



    </React.Fragment>
    </div>
);}

